		"text": "다양하게 변화한 헤어스타일만큼이나 시간이 흘렀다는 것을 깨닫는다. 캐스퍼라디오 @casperradio_ 식구 분들 고생하셨고, 정말 늘 막무가내로 덤비는 내 성격이 만든 그 시간들 동안 연륜의 힘으로 알찬 콘텐츠를 위해 노력해주신 윤하, 박국 씨에게 감사드린다."
