		"text": "1981년 8월, 남영동 대공분실 510호에서 한 달 넘게 고문을 받은 한 청년이 있습니다. 그 청년은 지금 일흔이 훌쩍 넘었고,  자신이 고문을 받던 그곳을 지키는 보안관리소장이 되었습니다.\n\n오늘의 민주주의는 대체 얼마나 많은 사람들의 피와 땀으로 이뤄진 것일까요?\n\n#610민주항쟁 https://t.co/Mvdmw9cNjD"
